import React from 'react';
import './App.css';
import EventFeed from './components/EventFeed';

function App() {
    return (
        <div className="app-container">
            <h1 className="title">Orchestrate Events Feed</h1>
            <EventFeed />
        </div>
    );
}

export default App;
